import Avatar from '../components/Avatar'

function Home() {
  return (
    <main>
      <header>
        <h1>FA.</h1>
      </header>

      <style>{`
        main {
          width: 100%;
          height: 100vh;
          background-image: linear-gradient(147deg, #323232 0%, #212121 74%);
        }

        main > h1 {
          margin: 0;
          padding: 0;
        }
      `}</style>

      <style jsx global>{`
        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }
        body {
          height: 100vh;
          font-family: 'Montserrat', sans-serif;
          color: #fff;
          background-color: #323232;
        }
      `}</style>
    </main>
  )
}

export default Home
